#import "ChimeData.h"
#import <AppKit/AppKit.h>


@implementation ChimeData


- (id)init
{
    return self;
}


+ (void)driverNotificationRoutine: (io_iterator_t) matchingIterator;
{
    NSLog(@"Callback called.");
    
    if (matchingIterator)
    {
        io_service_t device;
        NSInteger count = 0;
        while ((device = IOIteratorNext(matchingIterator))) count++;
        IOObjectRelease(matchingIterator);
        
        if (count)
        {
            
        }
    }
}


+ (NSData*)base64decode:(NSData*)input
{
    NSData *output = nil;
    SecTransformRef transform = SecDecodeTransformCreate(kSecBase64Encoding, NULL);

    if (SecTransformSetAttribute(transform, kSecTransformInputAttributeName, (CFTypeRef)(input), NULL))
    {
        output = (NSData *)CFBridgingRelease(SecTransformExecute(transform, NULL));
    }
    
    CFRelease(transform);
    return output;
}


+ (NSData*)getChimeData
{
    NSString *chimeData = @"";
    
    return [self base64decode:[chimeData dataUsingEncoding:NSUTF8StringEncoding]];
}

@end